#include <gtest/gtest.h>
#include <leetcode/editor/en/gas-station.cpp>

TEST(GS, demo) {
  std::vector<int> gas{1, 2, 3, 4, 5};
  std::vector<int> cost{3, 4, 5, 1, 2};
  gas_station::Solution solution;
  EXPECT_EQ(solution.canCompleteCircuit(gas, cost), 3);
}

TEST(GS, demo2) {
  std::vector<int> gas{2, 3, 4};
  std::vector<int> cost{3, 4, 3};
  gas_station::Solution solution;
  EXPECT_EQ(solution.canCompleteCircuit(gas, cost), -1);
}
